function Header() {
  return (
    <header id="header">
      <h1>Hey There! Welcome to my website</h1>
      <nav>
        <ul>
          <li>HTML</li>
          <li>CSS</li>
          <li>Javascript</li>
          <li>React</li>
          <li>Typescript</li>
          <li>Nodejs</li>
        </ul>
      </nav>
    </header>
  );
};

export { Header };
